import './App.css';

const like = ["acordar" , "fazer café", "escovar os dentes", "estudar"]



const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

function App() {
  return (
    <ol>
      {like.map((element) =>  Task(element) ) }
    </ol>
  );
}

export default App;
